CREATE TABLE vishny00_acc.acc_products
(
    id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    product_name varchar(255),
    product_art varchar(255),
    product_url varchar(255),
    product_descr text,
    product_unit varchar(255),
    product_const double,
    product_photo varchar(255),
    createdAt datetime NOT NULL,
    updatedAt datetime NOT NULL,
    accCategoryId int(11),
    accProductStatusId int(11),
    wc_id int(11),
    CONSTRAINT acc_products_ibfk_1 FOREIGN KEY (accCategoryId) REFERENCES vishny00_acc.acc_categories (id) ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT acc_products_ibfk_2 FOREIGN KEY (accProductStatusId) REFERENCES vishny00_acc.acc_product_statuses (id) ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE INDEX accCategoryId ON vishny00_acc.acc_products (accCategoryId);
CREATE INDEX accProductStatusId ON vishny00_acc.acc_products (accProductStatusId);
